  {
    "id": "app_title_bar",
    "type": "title_bar",
    "text": "Sem título 1 — LibreOffice Writer",
    "region": "top-bar",
    "components": [
      {
        "id": "app_minimize_button",
        "type": "button",
        "text": "Minimizar",
        "icon": "minimize",
        "region": "top-bar",
        "actions": ["onClick"]
      },
      {
        "id": "app_maximize_button",
        "type": "button",
        "text": "Maximizar",
        "icon": "maximize",
        "region": "top-bar",
        "actions": ["onClick"]
      },
      {
        "id": "app_close_button",
        "type": "button",
        "text": "Fechar",
        "icon": "close",
        "region": "top-bar",
        "actions": ["onClick"]
      }
    ]
  },
  {
    "id": "app_toolbar_main",
    "type": "toolbar",
    "region": "top-bar",
    "components": [
      {
        "id": "toolbar_save_button",
        "type": "button",
        "icon": "save",
        "text": "Salvar",
        "actions": ["onClick"]
      },
      {
        "id": "toolbar_print_button",
        "type": "button",
        "icon": "print",
        "text": "Imprimir",
        "actions": ["onClick"]
      },
      {
        "id": "toolbar_cut_button",
        "type": "button",
        "icon": "cut",
        "text": "Recortar",
        "actions": ["onClick"]
      },
      {
        "id": "toolbar_copy_button",
        "type": "button",
        "icon": "copy",
        "text": "Copiar",
        "actions": ["onClick"]
      },
      {
        "id": "toolbar_paste_button",
        "type": "button",
        "icon": "paste",
        "text": "Colar",
        "actions": ["onClick"]
      },
      {
        "id": "toolbar_undo_button",
        "type": "button",
        "icon": "undo",
        "text": "Desfazer",
        "actions": ["onClick"]
      },
      {
        "id": "toolbar_redo_button",
        "type": "button",
        "icon": "redo",
        "text": "Refazer",
        "actions": ["onClick"]
      }
    ]
  },
  {
    "id": "app_toolbar_formatting",
    "type": "toolbar",
    "region": "top-bar",
    "components": [
      {
        "id": "style_dropdown",
        "type": "select",
        "text": "Estilo de parágrafo Padrão",
        "actions": ["onChange"]
      },
      {
        "id": "font_family_dropdown",
        "type": "select",
        "text": "Arial",
        "actions": ["onChange"]
      },
      {
        "id": "font_size_dropdown",
        "type": "select",
        "text": "12 pt",
        "actions": ["onChange"]
      },
      {
        "id": "bold_button",
        "type": "button",
        "icon": "bold",
        "text": "Negrito",
        "actions": ["onClick"]
      },
      {
        "id": "italic_button",
        "type": "button",
        "icon": "italic",
        "text": "Itálico",
        "actions": ["onClick"]
      },
      {
        "id": "underline_button",
        "type": "button",
        "icon": "underline",
        "text": "Sublinhado",
        "actions": ["onClick"]
      }
    ]
  },
  {
    "id": "document_area",
    "type": "document_editor",
    "region": "main-content",
    "state": "focused"
  },
  {
    "id": "status_bar",
    "type": "status_bar",
    "region": "footer",
    "components": [
      {
        "id": "status_page_info",
        "type": "label",
        "text": "Página 1 de 1",
        "region": "footer"
      },
      {
        "id": "status_word_count",
        "type": "label",
        "text": "0 palavra, 0 caractere",
        "region": "footer"
      },
      {
        "id": "status_page_style",
        "type": "label",
        "text": "Estilo de página Padrão",
        "region": "footer"
      },
      {
        "id": "status_language",
        "type": "label",
        "text": "Português (Brasil)",
        "region": "footer"
      }
    ]
  },
  {
    "id": "insert_table_modal",
    "type": "modal",
    "text": "Inserir tabela",
    "region": "center",
    "components": [
      {
        "id": "modal_minimize_button",
        "type": "button",
        "icon": "minimize",
        "actions": ["onClick"]
      },
      {
        "id": "modal_maximize_button",
        "type": "button",
        "icon": "maximize",
        "actions": ["onClick"]
      },
      {
        "id": "modal_close_button",
        "type": "button",
        "icon": "close",
        "actions": ["onClick"]
      },
      {
        "id": "section_geral",
        "type": "section_header",
        "text": "Geral"
      },
      {
        "id": "label_nome",
        "type": "label",
        "text": "Nome:"
      },
      {
        "id": "input_nome_tabela",
        "type": "input",
        "text": "tabela1",
        "state": "focused",
        "actions": ["onChange"]
      },
      {
        "id": "label_colunas",
        "type": "label",
        "text": "Colunas:"
      },
      {
        "id": "input_colunas",
        "type": "spinner_input",
        "value": "2",
        "actions": ["onChange", "onIncrement", "onDecrement"]
      },
      {
        "id": "label_linhas",
        "type": "label",
        "text": "Linhas:"
      },
      {
        "id": "input_linhas",
        "type": "spinner_input",
        "value": "2",
        "actions": ["onChange", "onIncrement", "onDecrement"]
      },
      {
        "id": "section_opcoes",
        "type": "section_header",
        "text": "Opções"
      },
      {
        "id": "checkbox_titulo",
        "type": "checkbox",
        "text": "Título",
        "state": "unchecked",
        "actions": ["onClick"]
      },
      {
        "id": "checkbox_repetir_linhas_titulo",
        "type": "checkbox",
        "text": "Repetir linhas de título nas novas páginas",
        "state": "checked",
        "actions": ["onClick"]
      },
      {
        "id": "label_linhas_de_titulo",
        "type": "label",
        "text": "Linhas de título:",
        "state": "disabled",
        "meta": {
          "reason_disabled": "checkbox_titulo is unchecked"
        }
      },
      {
        "id": "input_linhas_de_titulo",
        "type": "spinner_input",
        "value": "1",
        "state": "disabled",
        "actions": ["onChange", "onIncrement", "onDecrement"],
        "meta": {
          "reason_disabled": "checkbox_titulo is unchecked"
        }
      },
      {
        "id": "checkbox_nao_dividir_tabela",
        "type": "checkbox",
        "text": "Não dividir tabela entre páginas",
        "state": "unchecked",
        "actions": ["onClick"]
      },
      {
        "id": "section_estilos",
        "type": "section_header",
        "text": "Estilos"
      },
      {
        "id": "listbox_estilos",
        "type": "listbox",
        "components": [
          {
            "id": "list_item_nenhum",
            "type": "list_item",
            "text": "Nenhum",
            "state": "selected",
            "actions": ["onClick"]
          },
          {
            "id": "list_item_estilo_tabela_padrao",
            "type": "list_item",
            "text": "Estilo de tabela Padrão",
            "actions": ["onClick"]
          },
          {
            "id": "list_item_academico",
            "type": "list_item",
            "text": "Acadêmico",
            "actions": ["onClick"]
          },
          {
            "id": "list_item_mundo_azul",
            "type": "list_item",
            "text": "Mundo azul",
            "actions": ["onClick"]
          },
          {
            "id": "list_item_mundo_verde",
            "type": "list_item",
            "text": "Mundo verde",
            "actions": ["onClick"]
          },
          {
            "id": "list_item_mundo_escarlate",
            "type": "list_item",
            "text": "Mundo escarlate",
            "actions": ["onClick"]
          },
          {
            "id": "list_item_mundo_alvorada",
            "type": "list_item",
            "text": "Mundo da alvorada",
            "actions": ["onClick"]
          },
          {
            "id": "list_item_elegante",
            "type": "list_item",
            "text": "Elegante",
            "actions": ["onClick"]
          }
        ]
      },
      {
        "id": "table_preview",
        "type": "table",
        "text": "Jan Fev Mar Soma\nNorte 6 7 8 21\nMeio 11 12 13 36\nSul 16 17 18 51\nSoma 33 36 39 108",
        "meta": {
          "description": "Preview of the selected table style"
        }
      },
      {
        "id": "button_ajuda",
        "type": "button",
        "text": "Ajuda",
        "actions": ["onClick"]
      },
      {
        "id": "button_inserir",
        "type": "button",
        "text": "Inserir",
        "state": "enabled",
        "actions": ["onClick"]
      },
      {
        "id": "button_cancelar",
        "type": "button",
        "text": "Cancelar",
        "actions": ["onClick"]
      }
    ]
  }
]
